const HireMe = () => (
  <Layout title="Hire me">
    <h1>Hire me</h1>
    <p>
      You can hire me at{" "}
      <a href="mailto:jgam@alumni.nd.edu">jgam@alumni.nd.edu</a>
    </p>
  </Layout>
);

export default HireMe;
